INSERT INTO `survey` VALUES ('awpv3',NULL,'awpv3','{\"blocks\": [{\"questions\": [{\"id\": \"q1\", \"text\": \"I feel I belong in my organization.\", \"type\": \"MultipleChoice\", \"choices\": [{\"id\": \"c1\", \"text\": \"Strongly disagree\", \"score\": 0}, {\"id\": \"c2\", \"text\": \"Disagree\", \"score\": 25}, {\"id\": \"c3\", \"text\": \"Neutral\", \"score\": 50}, {\"id\": \"c4\", \"text\": \"Agree\", \"score\": 75}, {\"id\": \"c5\", \"text\": \"Strongly agree\", \"score\": 100}], \"influencer\": \"Belonging in Company\"}, {\"id\": \"q2\", \"text\": \"Do you get up at the same time each morning, even if you do not have to work?\", \"type\": \"MultipleChoice\", \"choices\": [{\"id\": \"c1\", \"text\": \"Never\", \"score\": 0}, {\"id\": \"c2\", \"text\": \"Sometimes\", \"score\": 25}, {\"id\": \"c3\", \"text\": \"Often\", \"score\": 50}, {\"id\": \"c4\", \"text\": \"Most of the time\", \"score\": 75}, {\"id\": \"c5\", \"text\": \"All of the time\", \"score\": 100}], \"influencer\": \"Circadian Pattern Consistency\"}, {\"id\": \"q3\", \"text\": \"Do you go to bed at the same time each night, even if you do not have to work the next day?\", \"type\": \"MultipleChoice\", \"choices\": [{\"id\": \"c1\", \"text\": \"Never\", \"score\": 0}, {\"id\": \"c2\", \"text\": \"Sometimes\", \"score\": 25}, {\"id\": \"c3\", \"text\": \"Often\", \"score\": 50}, {\"id\": \"c4\", \"text\": \"Most of the time\", \"score\": 75}, {\"id\": \"c5\", \"text\": \"All of the time\", \"score\": 100}], \"influencer\": \"Circadian Pattern Consistency\"}, {\"id\": \"q4\", \"text\": \"Do you get up immediately after your first alarm? (as opposed to snoozing).\", \"type\": \"MultipleChoice\", \"choices\": [{\"id\": \"c1\", \"text\": \"Never\", \"score\": 0}, {\"id\": \"c2\", \"text\": \"Sometimes\", \"score\": 25}, {\"id\": \"c3\", \"text\": \"Often\", \"score\": 50}, {\"id\": \"c4\", \"text\": \"Most of the time\", \"score\": 75}, {\"id\": \"c5\", \"text\": \"All of the time\", \"score\": 100}], 